Beside new edition, for 1978 new paint process, presented year earlier on Versailles, was expanded to other Lincoln models. This process produced more glossy finish, but non-metallic paint colours continued to use old process. Other novelties included miles-to-empty fuel indicator that replaced previously used “low fuel” warning light, Ford’s new 40-channel CB radio, full integrated garage door opener control and driver’s side outside mirror mounted illuminated thermometer. Carriage roof option is added this year as a full length simulated convertible top (simulation with top up). It was available only in white and when equipped with this vinyl roof treatment power glass moon-roof was not available. Designer series again was available but with some changes in available colours. Bill Blass came in midnight cordovan exterior paint with light champagne landau vinyl top while interior had velour/cloth or leather/vinyl combination. First option was priced at 1533$ and second at 1800$. Cartier edition came in light champagne body colour with light champagne landau vinyl top. Standard metal finished roof was offered at no extra cost, full vinyl roof at extra cost. Interior had leather/vinyl or velour cloth combination, both of them priced at 1800$. Pucci edition came in light silver metallic exterior and black landau vinyl roof with interior was in leather/vinyl, priced at 1800$. Fourth model in Designer series, Givenchy, had midnight jade body colour combined with unique forward half-vinyl roof in light chamois. It had same price as Pucci edition-1800$. In it’s second year of availability Mark V sales stayed strong with over 70000 copies, bit less than 1977. Again, it was better than competition. Direct rival, Cadillac Eldorado found 46000 buyers in 1978. Of all Mark V’s produced for 1978, 16537 of them had one of four Designer packages: Bill Blass–3975, Cartier-8520, Pucci-3125 and Givenchy-917. Continuing... #lincoln #lincolncontinental #lincolnmarkv #markV #1977 #1970s